import React, { Component } from "react";
import Posts from "../components/Posts";

class Dashboard extends Component {
  render() {
    return (
      <div className="dashboard">
        <h2>hellow again</h2>
        <h2>
          {this.props.name.id} {this.props.name.name}
        </h2>
        <Posts />
      </div>
    );
  }
}

export default Dashboard;
